import Modal from "../../components/modal";
import AddClient from "../../components/form";

export default function ClientAdd(props) {

  return (
    <Modal
      open={props.open}
      handleClose={props.handleClose}
      renderContent={<AddClient handleClose={props.handleClose}  handleOpen={props.handleOpen} onChange={props.onChange}  addClient={props.addClient}  open={props.open} />}
      width="40%"
    />
  );
}
